//function to dynamically load search results
const searchInput = document.getElementById('get-city-name');
const searchResults = document.getElementById('searchResults');
let weatherData='';

// Event listener for input changes
searchInput.addEventListener('input', function() {
    const inputValue = searchInput.value.toLowerCase(); // Convert input value to lowercase

    // Clear previous search results
    searchResults.innerHTML = '';

    // Filter cities based on user input
    const filteredCities = cities.filter(city => {
        return city.toLowerCase().includes(inputValue); // Filter cities whose names contain the input
    });

    // Display search results
    filteredCities.forEach(city => {
        const li = document.createElement('li');
        li.textContent = city;
        li.addEventListener('click', function() {
            // Set input value to the clicked city name
            searchInput.value = city;
            // Hide the dropdown
            searchResults.style.display = 'none';
            getWeather();
        });
        searchResults.appendChild(li);
    });

    // Display the dropdown if there are search results
    if (filteredCities.length > 0) {
        searchResults.style.display = 'block';
    } else {
        searchResults.style.display = 'none';
    }
});

// Event listener for clicks outside the dropdown
document.addEventListener('click', function(event) {
    // Check if the clicked element is outside the dropdown and input
    if (!searchResults.contains(event.target) && event.target !== searchInput) {
        // Hide the dropdown
        searchResults.style.display = 'none';
    }
});

// Clear Search Results

function clearInput() {
    document.getElementById('get-city-name').value = '';
  }
// function to fetch weather by location

function getWeatherByCoordinates() {

    // checkWeather();
    var getWeatherDetailsWidget=document.getElementById('getWeatherDetails');
    if(getWeatherDetailsWidget.style.display==='none'){
        getWeatherDetailsWidget.style.display='block';
    }
    // Get the current position of the device
    navigator.geolocation.getCurrentPosition(function(position) {
        // Retrieve the latitude and longitude from the position object
        const latitude = position.coords.latitude.toString();
        const longitude = position.coords.longitude.toString();
        const coordiantes=latitude+', '+longitude;
        const url= 'https://weatherapi-com.p.rapidapi.com/current.json?q=' + coordiantes;
        // Do something with the latitude and longitude
        console.log('Latitude:', latitude);
        console.log('Longitude:', longitude);
        const xhr = new XMLHttpRequest();
        xhr.withCredentials = true;
        
        xhr.addEventListener('readystatechange', function () {
            if (this.readyState === this.DONE) {
                if (this.status === 200) {
                    weatherData=this.responseText;
                    displayWeatherInfo(this.responseText);
                    fetchHourlyForecast(latitude, longitude);
                } else {
                    console.error('Error fetching weather data. Status:', this.status);
                    alert("Sorry!! We don't have this location's data at this moment!!");
                }
            }
        });
    
        xhr.onerror = function () {
            console.error('An error occurred during the request.');
        };
    
        xhr.open('GET', url);
        xhr.setRequestHeader('X-RapidAPI-Key', 'c4740aea08msh56f4945256fc23ap1aba5ejsnf54583c100f1');
        xhr.setRequestHeader('X-RapidAPI-Host', 'weatherapi-com.p.rapidapi.com');
        xhr.send();
    
    }, function(error) {
        // Handle any errors that occur while retrieving the location
        console.error('Error getting location:', error.message);
    });
} 
// function to fetch weather by city name
function getWeather(){
    var getWeatherDetailsWidget=document.getElementById('getWeatherDetails');
    if(getWeatherDetailsWidget.style.display==='none'){
        getWeatherDetailsWidget.style.display='block';
    }
    const cityName = document.getElementById('get-city-name').value;
    if(cityName===''){
        alert("Please enter a location!");
        getWeatherByCoordinates();
        alert("Weather for Current Location will be displayed!");
    }
    else{
        const url = 'https://weatherapi-com.p.rapidapi.com/current.json?q=' + cityName;
    const xhr = new XMLHttpRequest();
    xhr.withCredentials = true;
    
    xhr.addEventListener('readystatechange', function () {
        if (this.readyState === this.DONE) {
            if (this.status === 200) {
                displayWeatherInfo(this.responseText);
                fetchHourlyForecast(JSON.parse(this.responseText).location.lat,JSON.parse(this.responseText).location.lon);
            } else {
                console.error('Error fetching weather data. Status:', this.status);
                alert("Sorry!! We don't have this location's data at this moment!!");
                getWeatherByCoordinates();
                alert("Weather for Current Location will be displayed!");
            }
        }
    });

    xhr.onerror = function () {
        console.error('An error occurred during the request.');
    };

    xhr.open('GET', url);
    xhr.setRequestHeader('X-RapidAPI-Key', 'c4740aea08msh56f4945256fc23ap1aba5ejsnf54583c100f1');
    xhr.setRequestHeader('X-RapidAPI-Host', 'weatherapi-com.p.rapidapi.com');
    xhr.send();
    }
    

}

