function displayWeatherInfo(weatherData) {
    const data = JSON.parse(weatherData);
    // const myDiv=document.getElementById('getWeatherDetails');
    // if(myDiv.style.display==='none'){
    //     myDiv.style.display='block'
    // }else {
    //     myDiv.style.display='none';
    // }
    const currentWeather = data.current;
    if (currentWeather) {
        const temperatureElement = document.getElementById('temperature');
        const localTimeElement=document.getElementById('localTime');
        const feelsLikeElement=document.getElementById('feelsLike');
        const locationElement = document.getElementById('location');
        const conditionIconElement = document.getElementById('conditionicon');
        const conditionElement = document.getElementById('condition');
        const windElement = document.getElementById('wind');
        const gustElement= document.getElementById('gust');
        const cloudCoverElement= document.getElementById('cloudcover');
        const uvElement= document.getElementById('uv');
        const humidityElement = document.getElementById('humidity');
        locationElement.textContent = data.location.name + ', ' + data.location.region + ', ' + data.location.country;
        if (feelsLikeElement) {
            feelsLikeElement.textContent = 'Feels Like: ' + currentWeather.feelslike_c + ' °C';
        } else {
            console.error('Element with ID "feelsLike" not found.');
        }
        gustElement.textContent='Gust Speed: '+currentWeather.gust_kph +'kph';
        cloudCoverElement.textContent='Cloud Cover(%): '+ currentWeather.cloud;
        cloudCoverElement.innerHTML+=`<img src="cloudcover.svg" alt="wind-icon"; style="margin-left: 15px">`;
        uvElement.textContent='UV index: '+currentWeather.uv;
        temperatureElement.textContent = currentWeather.temp_c + ' °C';
        temperatureElement.innerHTML+=`<img src="temperature.gif" alt="temperature-icon"; style="margin-left: 15px;margin-top: 10px">`;
        localTimeElement.textContent=retunDay(data.location.localtime)+', '+ formatTime12Hour(data.location.localtime);
        conditionIconElement.textContent='';
        if(conditionElement){
            conditionElement.textContent = 'Weather Condition: ' + currentWeather.condition.text;
        }
        else {
            console.error('Element with ID "condition" not found.');
        }
 

        if (conditionElement) {
            const conditionText = conditionIconElement.textContent;
            let conditionHTML = conditionText;
        
            if (currentWeather.condition.text.toLowerCase().replace(/\s+$/, '') === 'partly cloudy') {
                if(dayOrNight(data.location.localtime)==='day'){
                    conditionHTML += `<img src="https://www.amcharts.com/wp-content/themes/amcharts4/css/img/icons/weather/animated/cloudy-day-1.svg" alt="Partly Cloudy Day Icon">`;
                }
                else{
                    conditionHTML += `<img src="https://www.amcharts.com/wp-content/themes/amcharts4/css/img/icons/weather/animated/cloudy-night-1.svg" alt="Partly Cloudy Night Icon">`;
                }
            }
            if (currentWeather.condition.text.toLowerCase().replace(/\s+$/, '') === 'mist' ||currentWeather.condition.text.toLowerCase().replace(/\s+$/, '') === 'cloudy' || currentWeather.condition.text.toLowerCase().replace(/\s+$/, '')==='overcast') {
                if(dayOrNight(data.location.localtime)==='day'){
                    conditionHTML += `<img src="https://www.amcharts.com/wp-content/themes/amcharts4/css/img/icons/weather/animated/cloudy.svg" alt="Cloudy Day Icon">`;
                }
                else{
                    conditionHTML += `<img src="https://www.amcharts.com/wp-content/themes/amcharts4/css/img/icons/weather/animated/cloudy.svg" alt="Cloudy Night Icon">`;
                }
            }
            if (currentWeather.condition.text.toLowerCase().replace(/\s+$/, '') === 'clear'||currentWeather.condition.text.toLowerCase().replace(/\s+$/, '') === 'sunny') {
                if(dayOrNight(data.location.localtime)==='day'){
                    conditionHTML += `<img src="https://www.amcharts.com/wp-content/themes/amcharts4/css/img/icons/weather/animated/day.svg" alt="Clear Day Icon">`;
                }
                else{
                    conditionHTML += `<img src="https://www.amcharts.com/wp-content/themes/amcharts4/css/img/icons/weather/animated/night.svg" alt="Clear Night Icon">`;
                }
            }

            if (currentWeather.condition.text.toLowerCase().replace(/\s+$/, '') === 'light rain shower'||currentWeather.condition.text.toLowerCase().replace(/\s+$/, '') === 'patchy rain nearby'||currentWeather.condition.text.toLowerCase().replace(/\s+$/, '')==='light freezing rain') {
                if(dayOrNight(data.location.localtime)==='day'){
                    conditionHTML += `<img src="https://www.amcharts.com/wp-content/themes/amcharts4/css/img/icons/weather/animated/rainy-1.svg" alt="Light Rain Day Icon">`;
                }
                else{
                    conditionHTML += `<img src="https://www.amcharts.com/wp-content/themes/amcharts4/css/img/icons/weather/animated/rainy-5.svg" alt="Light Rain Night Icon">`;
                }
            }
            if (currentWeather.condition.text.toLowerCase().replace(/\s+$/, '') === 'patchy light rain in area with thunder' ||currentWeather.condition.text.toLowerCase().replace(/\s+$/, '') === 'moderate or heavy rain with thunder' ||currentWeather.condition.text.toLowerCase().replace(/\s+$/, '') === 'patchy light rain with thunder') {
                if(dayOrNight(data.location.localtime)==='day'){
                    conditionHTML += `<img src="https://www.amcharts.com/wp-content/themes/amcharts4/css/img/icons/weather/animated/thunder.svg" alt="Light Rain-thunder Day Icon">`;
                }
                else{
                    conditionHTML += `<img src="https://www.amcharts.com/wp-content/themes/amcharts4/css/img/icons/weather/animated/thunder.svg" alt="Light Rain-thunder Night Icon">`;
                }
            }
            conditionIconElement.innerHTML = conditionHTML;
        } else {
            console.error('Element with ID "condition" not found.');
        }

        windElement.textContent = 'Wind Speed: ' + currentWeather.wind_kph + ' kph ' + currentWeather.wind_dir;
        windElement.innerHTML+=`<img src="wind.gif" alt="wind-icon"; style="margin-left: 15px">`;
        humidityElement.textContent = 'Humidity: ' + currentWeather.humidity + '%';
        humidityElement.innerHTML+=`<img src="humidity.png" alt="humidity-icon"; style="margin-left: 15px">`;
    } else {
        console.error('Invalid weather data format:', data);
    }
}


// gets formatted time from local time
function formatTime12Hour(dateTimeString) {
    // Create a Date object from the provided date-time string
    const date = new Date(dateTimeString);

    // Get hours and minutes from the Date object
    let hours = date.getHours();
    let minutes = date.getMinutes();

    // Determine AM or PM
    const meridiem = hours >= 12 ? 'PM' : 'AM';

    // Convert hours to 12-hour format
    hours = hours % 12 || 12;

    // Add leading zero to minutes if needed
    minutes = minutes < 10 ? '0' + minutes : minutes;

    // Construct the formatted time string
    const formattedTime = hours + '.' + minutes + ' ' + meridiem;

    return formattedTime;
}

function retunDay(dateTimeString){
    const date =new Date(dateTimeString);
    let days= date.getDay();
    if (days===1)
    {
        return 'Monday';
    }
    if (days===2)
    {
        return 'Tuesday';
    }
    if (days===3)
    {
        return 'Wednesday';
    }
    if (days===4)
    {
        return 'Thursday';
    }
    if (days===5)
    {
        return 'Friday';
    }
    if (days===6)
    {
        return 'Saturday';
    }
    if (days===7)
    {
        return 'Sunday';
    }
}
function dayOrNight(dateTimeString){
    const date= new Date(dateTimeString);
    let hours=date.getHours();

    if(hours> 6 && hours <18)
    {
        return 'day';
    }
    else 
    {
        return 'night';
    }
}

// Function to handle the onclick event of the share button
function shareWeatherToFacebookOnClick() {
    // Check if weatherData is available
    if (typeof weatherData === 'undefined') {
        alert("Please get the weather report first before sharing.");
        return;
    }

    // Share weather data to Facebook
    shareWeatherToFacebook(weatherData);
}

// Function to share weather details to Facebook
function shareWeatherToFacebook(weatherData) {
    // Check if weatherData is provided and is not empty
    if (!weatherData || Object.keys(weatherData).length === 0) {
        alert("Please get the weather report first before sharing.");
        return;
    }

    // Convert JSON weather data to readable text format
    const formattedWeather = formatWeatherData(weatherData);

    // Check if the browser supports sharing via Facebook
    if (navigator.share) {
        navigator.share({
            title: 'Weather Report',
            text: formattedWeather,
            url: 'https://soprso.github.io/WeatherForeCast/index.html', // Replace with your weather website URL
        })
        .then(() => console.log('Weather shared successfully'))
        .catch((error) => console.error('Error sharing weather:', error));
    } else {
        // If sharing to Facebook is not supported, provide fallback option
        const facebookShareUrl = `https://www.facebook.com/sharer/sharer.php?u=${encodeURIComponent('https://your-weather-website.com')}&quote=${encodeURIComponent(formattedWeather)}`;
        window.open(facebookShareUrl, '_blank');
    }
}

// Function to format weather data into readable text format
function formatWeatherData(weatherData) {
    // Extract relevant information from weatherData
    const location = JSON.parse(weatherData).location.name;
    const temperature = JSON.parse(weatherData).current.temp_c + '°C';
    
    // Construct the formatted text
    const formattedWeather = `Location: ${location}\nTemperature: ${temperature}`;

    return formattedWeather;
}



const container = document.getElementById('hourlyForecast');

container.addEventListener('wheel', (event) => {
    container.scrollLeft += event.deltaY;
    event.preventDefault();
});

function convertTo12HourFormat(time24Hour) {
    // Split the time into hours, minutes, and seconds
    const [hours, minutes, seconds] = time24Hour.split(':').map(Number);

    // Determine AM or PM
    const period = hours >= 12 ? 'PM' : 'AM';

    // Convert hours to 12-hour format
    const hours12 = hours % 12 || 12;

    // Construct the 12-hour format time string
    const time12Hour = `${hours12}:${minutes < 10 ? '0' : ''}${minutes} ${period}`;

    return time12Hour;
}




function fetchHourlyForecast(latitude, longitude) {
    // Construct the URL with custom latitude and longitude
    const apiUrl = `https://weather.visualcrossing.com/VisualCrossingWebServices/rest/services/timeline/${latitude}%2C${longitude}?unitGroup=metric&key=FE29JLDPPFW368TH93TMPZJRV&contentType=json`;

    // Array to store hourly forecast data for the next 48 hours
    const hourlyForecastArray = [];

    // Fetch data from the API
    fetch(apiUrl)
        .then(response => response.json())
        .then(data => {
            // Get the hourly data for the next 48 hours
            const maxTempElement = document.getElementById('maxTemp');
            const minTempElement = document.getElementById('minTemp');
            const sunRiseElement = document.getElementById('sunRise');
            const sunSetElement = document.getElementById('sunSet');
            const hourlyDataToday = data.days[0].hours;
            const hourlyDataTomorrow = data.days[1].hours;
            const hourlyDataDayAfterTomorrow=data.days[2].hours;
            const hourlyDataTwoDaysAfterTomorrow=data.days[3].hours;
            const combinedHourlyData = [...hourlyDataToday, ...hourlyDataTomorrow,...hourlyDataDayAfterTomorrow, ...hourlyDataTwoDaysAfterTomorrow];
            maxTempElement.textContent = 'Max :'+data.days[0].tempmax+' °C';
            minTempElement.textContent = 'Min :'+data.days[0].tempmin+' °C';
            sunRiseElement.textContent = convertTo12HourFormat(data.currentConditions.sunrise);
            sunRiseElement.innerHTML=`<img src="sunrise.svg" alt="sunrise-icon"><br>`+sunRiseElement.innerHTML;
            sunSetElement.textContent = convertTo12HourFormat(data.currentConditions.sunset);
            sunSetElement.innerHTML=`<img src="sunset.svg" alt="sunset-icon"><br>`+sunSetElement.innerHTML;
            // Iterate over each hour of the next 96 hours
            for (let i = 0; i < 96; i++) {
                const hourData = combinedHourlyData[i];

                // Store the hour's data in the array
                hourlyForecastArray.push({
                    time: hourData.datetime,
                    temperature: hourData.temp,
                    condition: hourData.conditions
                });

                // Convert datetime to 12-hour format with AM and PM
                const time24Hour = parseInt(hourData.datetime.split(':')[0]);
                let hours12 = (time24Hour + 11) % 12 + 1;
                const amPm = time24Hour >= 12 ? 'PM' : 'AM';
                if (hours12 < 10) {
                    hours12 = '0' + hours12; // Add leading zero for single-digit hours
                }
                const time12Hour = hours12 + ':00 ' + amPm;

                // Get the day from the date
                const day = new Date(hourData.datetimeEpoch * 1000).toLocaleDateString('en-US', { weekday: 'long' });

                // Get the HTML element corresponding to the hour
                const hourlyElement = document.getElementById(`hour${String(i).padStart(2, '0')}`);
                if (hourlyElement) {
                    // Display the day, time, temperature, and condition in the HTML element
                    hourlyElement.innerHTML = `${day}<br>${time12Hour}<br><img src="${hourData.icon}.svg" alt="${hourData.conditions}"><br>${hourData.temp}°C<br>${hourData.conditions}`;

                }
                //createGraph(hourlyForecastArray);
            }

        })
        .catch(error => {
            console.error('Error fetching data:', error);
        });

         // Return the array containing hourly forecast data
}


